import ExpenseItem from "./ExpenseItem";
import './Expenses.css'
function Expenses(props) {
    console.log(props.expenses)
    return (
        <div>
            <ExpenseItem title={props[0].expenses.title} amount={props[0].amount} date={props[0].date} key={props[0].id}/>
        </div>
    );

}

export default Expenses;
